const getProducts = () => {
  return fetch('products.json')
    .then((response) => response.json())
    .then((products) => {
      console.log(products);
      return (products || []).map((product) => {
        console.log(product.code)
        return {
          id: product.code,
          name: product.name,
        };
      });
    });
};

export default getProducts;
